Some authorization code can be abstracted into custom hooks. This includes the following

### frontend/components/SearchPage/SearchPage.js:74
```javascript
useEffect(() => {
  if (!auth.isAuthenticated()) {
    auth.login();
  }
});
```

### frontend/components/SearchPage/SearchPage.js:69
```javascript
const headers = new Headers();
if (localStorage.getItem('access_token')) {
   headers.append('Authorization', `Bearer ${localStorage.getItem('access_token')}`);
}
```

I will look into this more and come up with a clean solution.
